pragma solidity ^0.8.0;

contract Patent {
    uint256 public patentCount;

    constructor() {
        patentCount = 0;
    }

    function registerPatent(string memory title, string memory description) public returns (uint256) {
        patentCount++;
        return patentCount;
    }
}
